export default function Main() {
    return (
      <header>
        <div>
          <h3 className='logo'>스타트 팜</h3>
          <ul className="menu">
            <li><a href="#">귀농 한달살이</a></li>
            <li><a href="#">농산물 펀딩</a></li>
            <li><a href="#">클린 농촌마을</a></li>
          </ul>
        </div>
        <p>귀농의 처음부터 끝까지!</p>
      </header>
    );
  }
